  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "react-app"
    }}>{`react-app`}</h1>
    <blockquote>
      <p parentName="blockquote">{`The other component working in junction with MQTTCon is our react-app folder, which is
responsible for the front end of the application. Implementation for the user interface, login/signup logic,
and MQTT object retrieval can be found here. `}<br /><br /></p>
      <p parentName="blockquote">{`As with all react.js applications, the key entry points begin at App.js and Index.js.
We highly suggest looking at their documentation first!`}</p>
    </blockquote>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
